resources.string:
Bateria %s încarcă afișajul braille.

Ca să economisești baterie:

 1. accesează setările afișajului Braille;
 2. deconectează afișajul Braille de la USB;
 3. conectează-te la afișajul Braille folosind Bluetooth.

Iată câteva lucruri pe care le poți spune:

• „Copiază”;
• „Citește de la elementul focalizat”;
• „Caută [salvează]”;
• „Vorbește [mai repede]”;
• „Setări TalkBack”.

Rostește „%1$s” pentru lista completă a comenzilor vocale.

După instalarea Modului de lectură:

1. accesează Setări > Accesibilitate > Mod de lectură;
2. activează comanda rapidă;
3. accesează o aplicație sau un site și folosește comanda rapidă pentru a deschide Modul de lectură.

După instalarea Modului de lectură:

1. accesează Setări, apoi Accesibilitate, apoi Modul de lectură;
2. activează comanda rapidă;
3. accesează o aplicație sau un site și folosește comanda rapidă pentru a deschide Modul de lectură.

Când este activat serviciul Selectează și ascultă, poți atinge anumite elemente de pe ecran pentru a le auzi citite cu voce tare.

Pornește Selectează și ascultă. Apoi vei putea:

• să atingi un anumit element, cum ar fi un text sau o imagine;
• să tragi cu degetul pe ecran pentru a selecta mai multe elemente;
• să atingi butonul de redare pentru a auzi totul de pe ecran;
• să selectezi textul ce apare în vizorul camerei foto
